    playbackData.comments = {"68bb8e04-13da-44ba-902d-4d455d0c2704":[{"id":"1212de67-028f-40af-9461-5250684ad508","displayCommentEventId":"68bb8e04-13da-44ba-902d-4d455d0c2704","displayCommentEventSequenceNumber":0,"developerGroupId":"953382f1-4712-4d7a-acd7-d7d02a30e9b0","timestamp":1695861321371,"commentText":"In this code story, we'll build our own versions of <span style=\"font-family: Courier;\">zip</span> and <span style=\"font-family: Courier;\">unzip</span>.&nbsp;<div><br></div><div>Building <span style=\"font-family: Courier;\">zip</span> is pretty straightforward, but building <span style=\"font-family: Courier;\">unzip</span> will take a bit of clever thinking.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"c910d007-0e0d-4a77-ac64-b81c890f2840":[{"id":"b812302c-1015-4a65-addf-f46495aa2a1b","displayCommentEventId":"c910d007-0e0d-4a77-ac64-b81c890f2840","displayCommentEventSequenceNumber":71,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695861689838,"commentText":"Let's start with the type declaration. The function<span style=\"font-family: Courier;\">'zip</span>&nbsp;will take two lists as parameters and return a list of pairs.&nbsp;<div><br></div><div>The two lists don't have to have the same type, so we use two type variables, <span style=\"font-family: Courier;\">a</span> and <span style=\"font-family: Courier;\">b</span>. The result will be a list of <span style=\"font-family: Courier;\">(a,b)</span> pairs.</div>","commentTitle":"Type declaration (zip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"zip' :: [a] -> [b] -> [(a,b)]","startRow":2,"startColumn":0,"endRow":2,"endColumn":29}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"zip' :: [a] -> [b] -> [(a,b)]","commentTags":[],"questionCommentData":null}],"00746669-34f1-4bef-bff1-2c4298542a71":[{"id":"790da335-9d55-4c9a-acc0-2374c2c54a17","displayCommentEventId":"00746669-34f1-4bef-bff1-2c4298542a71","displayCommentEventSequenceNumber":115,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695861766198,"commentText":"This time, let's start with the recursive case.<div><br></div><div>Using pattern matching, we break down both lists into their heads and tails. The two heads form a new pair, and we cons that onto the result of a recursive call on the two tails.</div>","commentTitle":"Recursive case (zip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"zip' (x:xs) (y:ys) = (x,y):(zip' xs ys)","startRow":3,"startColumn":0,"endRow":3,"endColumn":39}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"zip' (x:xs) (y:ys) = (x,y):(zip' xs ys)","commentTags":[],"questionCommentData":null}],"fab2ae58-39f3-4ce3-8396-2c52229df537":[{"id":"275a20b8-e9ba-48f3-b47d-74b404c0c31e","displayCommentEventId":"fab2ae58-39f3-4ce3-8396-2c52229df537","displayCommentEventSequenceNumber":137,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695861796183,"commentText":"The ideal base case is that both parameter lists are empty. In that case, the result should also be an empty list.","commentTitle":"Base case (zip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"zip' [] [] = []","startRow":3,"startColumn":0,"endRow":3,"endColumn":15}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"zip' [] [] = []","commentTags":[],"questionCommentData":null}],"01e2caad-98d0-4a72-b59b-9afd125e622c":[{"id":"754c2683-67e3-4916-bee9-638b49ebf0d5","displayCommentEventId":"01e2caad-98d0-4a72-b59b-9afd125e622c","displayCommentEventSequenceNumber":281,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695861908417,"commentText":"But what if one list is empty while the other list still has values remaining? It doesn't really make sense to zip two lists of different lengths, so let's treat these cases as error.<div><br></div><div>We need two error cases to account for either list being the shorter one. And we put the error cases after the base case because the base case has a more specific pattern.</div>","commentTitle":"Error cases (zip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"zip' [] _  = error \"Lists must be the same length\"\nzip' _ []  = error \"Lists must be the same length\"","startRow":4,"startColumn":0,"endRow":5,"endColumn":50}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"zip' [] _  = error \"Lists must be the same length\"\nzip' _ []  = error \"Lists must be the same length\"","commentTags":[],"questionCommentData":null}],"fd116753-eb02-42a1-a277-64062ecb6354":[{"id":"231d167e-3dd3-4153-8c66-819337441a8e","displayCommentEventId":"fd116753-eb02-42a1-a277-64062ecb6354","displayCommentEventSequenceNumber":333,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695861955117,"commentText":"Finally, let's test our function! When you run this program, you should see<div><br></div><div><span style=\"font-family: Courier;\">[(1,'a'),(2,'b'),(3,'c')]</span></div>","commentTitle":"Testing (zip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"(zip' [1,2,3] \"abc\")","startRow":0,"startColumn":22,"endRow":0,"endColumn":42}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (zip' [1,2,3] \"abc\"))","commentTags":[],"questionCommentData":null}],"1755a8dd-146d-4d58-a3df-36b58e68a7c4":[{"id":"4289b6b5-c329-4448-9219-c8af8760aeee","displayCommentEventId":"1755a8dd-146d-4d58-a3df-36b58e68a7c4","displayCommentEventSequenceNumber":373,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695862092425,"commentText":"The function <span style=\"font-family: Courier;\">unzip'</span> is the inverse function for <span style=\"font-family: Courier;\">zip'</span>. It takes a list of pairs and returns a pair of lists.&nbsp;<div><br></div><div>As in most programming languages, a Haskell function has only a single return value. So we group the two result lists into a tuple.</div>","commentTitle":"Type declaration (unzip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"unzip' :: [(a,b)] -> ([a],[b])","startRow":8,"startColumn":0,"endRow":8,"endColumn":30}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"unzip' :: [(a,b)] -> ([a],[b])","commentTags":[],"questionCommentData":null}],"c538b2de-5350-441d-887c-40e31a9baf2f":[{"id":"34534650-f7d8-410c-b97a-44ff32e54a59","displayCommentEventId":"c538b2de-5350-441d-887c-40e31a9baf2f","displayCommentEventSequenceNumber":403,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695862202808,"commentText":"The base case is straightforward enough.&nbsp;<div><br></div><div>When the parameter list is empty, we return a pair of empty lists, to match the type declaration.</div>","commentTitle":"Base case (unzip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"unzip' [] = ([],[])","startRow":9,"startColumn":0,"endRow":9,"endColumn":19}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"unzip' [] = ([],[])","commentTags":[],"questionCommentData":null}],"4a71f3d7-2a02-449f-b6a3-baf9417146ca":[{"id":"e3d078d3-a906-4096-b8aa-f7adf73faa92","displayCommentEventId":"4a71f3d7-2a02-449f-b6a3-baf9417146ca","displayCommentEventSequenceNumber":468,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695862408350,"commentText":"Now what about the recursive case? We'll use pattern matching to break out the elements of the first pair from the rest of the list.&nbsp;<div><br></div><div>And then things get messy. We want to stick <span style=\"font-family: Courier;\">x</span> and <span style=\"font-family: Courier;\">y</span> onto the lists of all the other <span style=\"font-family: Courier;\">xs</span> and <span style=\"font-family: Courier;\">ys</span> that we get back from the recursive call. But how?</div><div><br></div><div>If we try to run this code, we'll get a type error. Can you see why?</div>","commentTitle":"Recursive case, first attempt","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"unzip' ((x,y):rest) = (x:(unzip' rest), y:(unzip' rest))","startRow":10,"startColumn":0,"endRow":10,"endColumn":56}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"unzip' ((x,y):rest) = (x:(unzip' rest), y:(unzip' rest))","commentTags":[],"questionCommentData":null}],"663b7778-3138-4ef7-a927-b7260c6c816c":[{"id":"4749021f-7d43-4512-8098-318f26518bc4","displayCommentEventId":"663b7778-3138-4ef7-a927-b7260c6c816c","displayCommentEventSequenceNumber":480,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695862549822,"commentText":"Haskell provides built-in functions for extracting the first and second values in a tuple, <span style=\"font-family: Courier;\">fst</span> and <span style=\"font-family: Courier;\">snd</span>. Here they are in action:<div><br></div><div><div><span style=\"font-family: Courier;\">&gt; fst (17,42)</span></div><div><span style=\"font-family: Courier;\">17</span></div><div><span style=\"font-family: Courier;\">&gt; snd (17,42)</span></div><div><span style=\"font-family: Courier;\">42</span></div></div><div><br></div><div>Let's try using those to extract the first and second lists from the pair of lists from the recursive calls.</div>","commentTitle":"Recursive case, second attempt","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"(x:(fst (unzip' rest)), y:(snd (unzip' rest)))","startRow":10,"startColumn":22,"endRow":10,"endColumn":68}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"unzip' ((x,y):rest) = (x:(fst (unzip' rest)), y:(snd (unzip' rest)))","commentTags":[],"questionCommentData":null}],"14f15f7c-30b4-4c0a-8df5-a37bf7cbe6a9":[{"id":"61d21d56-86eb-4803-8dbb-9ae76d7175d5","displayCommentEventId":"14f15f7c-30b4-4c0a-8df5-a37bf7cbe6a9","displayCommentEventSequenceNumber":540,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695862648712,"commentText":"This actually works! Try it and see.<div><br></div><div>But I'm not very happy with this implementation. Can you see why?</div>","commentTitle":"Testing (unzip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"unzip' [(1,\"one\"),(2,\"two\"),(3,\"three\")]","startRow":0,"startColumn":23,"endRow":0,"endColumn":63}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = putStrLn (show (unzip' [(1,\"one\"),(2,\"two\"),(3,\"three\")]))","commentTags":[],"questionCommentData":null},{"id":"ebad3e54-92fd-4e36-b388-3f6ab12147ac","displayCommentEventId":"14f15f7c-30b4-4c0a-8df5-a37bf7cbe6a9","displayCommentEventSequenceNumber":540,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695862729787,"commentText":"We make two recursive calls to <span style=\"font-family: Courier;\">unzip'</span>, one for each of the two lists. Once again, that means a function that should run in linear time is instead exponential.","commentTitle":"Exponential runtime","position":1,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"(x:(fst (unzip' rest)), y:(snd (unzip' rest)))","startRow":10,"startColumn":22,"endRow":10,"endColumn":68}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"unzip' ((x,y):rest) = (x:(fst (unzip' rest)), y:(snd (unzip' rest)))","commentTags":[],"questionCommentData":null}],"c2fd11cd-5c88-4db2-9688-7396da65a9ca":[{"id":"86bf22c3-053c-4e9e-aaa6-3c07f1d1fc7f","displayCommentEventId":"c2fd11cd-5c88-4db2-9688-7396da65a9ca","displayCommentEventSequenceNumber":573,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695863158607,"commentText":"We can make our recursive call in a <span style=\"font-family: Courier;\">where</span> clause, and use pattern matching to assign names to each of the two lists in the resulting pair.&nbsp;<div><br></div><div>We'll name them <span style=\"font-family: Courier;\">xs</span> and <span style=\"font-family: Courier;\">ys</span> to match up with the single values in the pair <span style=\"font-family: Courier;\">(x,y)</span> at the start of the list.</div>","commentTitle":"Pattern matching to the rescue!","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"  where (xs,ys) = unzip' rest","startRow":11,"startColumn":0,"endRow":11,"endColumn":29}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"  where (xs,ys) = unzip' rest","commentTags":[],"questionCommentData":null}],"bbdbb527-5f8b-4ad9-8d60-dfd95a561f9d":[{"id":"ae6cf3f9-bea0-4b8e-8f46-cfb006c97a4d","displayCommentEventId":"bbdbb527-5f8b-4ad9-8d60-dfd95a561f9d","displayCommentEventSequenceNumber":633,"developerGroupId":"5caa3569-296e-4062-84a6-05875bec0ca9","timestamp":1695867034461,"commentText":"Now we can change the base case to use the new local variables, <span style=\"font-family: Courier;\">xs</span> and <span style=\"font-family: Courier;\">ys</span>.<div><br></div><div>Not only is the final version of <span style=\"font-family: Courier;\">unzip'</span> as efficient as it should be, it's also very clear and easy to read.</div>","commentTitle":"Function complete (unzip')","position":0,"selectedCodeBlocks":[{"fileId":"26dc942d-0c3a-44da-80f1-a857f3a7f3eb","selectedText":"(x:xs,y:ys)","startRow":10,"startColumn":22,"endRow":10,"endColumn":33}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"unzip' ((x,y):rest) = (x:xs,y:ys)","commentTags":[],"questionCommentData":null}]};
